import React from 'react';
import './Header.css';

import RandomVideo from '../RandomVideo/RandomVideo';


class Header extends React.Component {
  render() {
    return (
    	<div className="header">
	    	<h1 className="header_title">The Liu Family's Video Gallery</h1>
	    	<p className="header_description">A collection of the Liu family's home videos throughout the years</p>
	    	<YouTubeVideoList videoList={this.props.videoList['Howard_and_Billy_Videos']} categoryTitle={'Howard_and_Billy_Videos'}/>
    	</div>
    );
  }
}

export default Header;
